If you have many panels with different number of lines each and you want each line to be translucent proportional to the total number of lines (so that each panel has approx. the same alpha)

alpha_from_n &lt;- function(n, max_alpha = 0.75) {
   1 - (1 - max_alpha)^(1/n)
}

